INSERT INTO `mdl_course` (`id`, `category`, `sortorder`, `fullname`, `shortname`, `idnumber`, `summary`, `summaryformat`, `format`, `showgrades`, `newsitems`, `startdate`, `enddate`, `relativedatesmode`, `marker`, `maxbytes`, `legacyfiles`, `showreports`, `visible`, `visibleold`, `downloadcontent`, `groupmode`, `groupmodeforce`, `defaultgroupingid`, `lang`, `calendartype`, `theme`, `timecreated`, `timemodified`, `requested`, `enablecompletion`, `completionnotify`, `cacherev`, `originalcourseid`, `showactivitydates`, `showcompletionconditions`) VALUES
(1, 0, 1, 'Proyecto Interactivo Para la Educación laboral', 'PIPE', '', '', 0, 'site', 1, 3, 0, 0, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1698192800, 1698441750, 0, 0, 0, 1698464761, NULL, 0, NULL),
(2, 1, 10001, 'Inducción a la etapa laboral', 'IEL', '', '<p dir=\"ltr\" style=\"text-align: left;\">Este curso proporciona a los participantes las habilidades esenciales y los conocimientos necesarios para una transición exitosa de la educación al mundo laboral. A través de módulos interactivos y actividades prácticas, los estudiantes adquieren una comprensión integral de las expectativas del entorno laboral, las habilidades de comunicación efectiva, la gestión del tiempo, la resolución de problemas y el trabajo en equipo. Además, se abordan temas clave como la ética profesional, la adaptación a la cultura de la empresa y la promoción del desarrollo profesional continuo. Este curso de inducción les brinda a los participantes la confianza y las herramientas necesarias para alcanzar el éxito en sus carreras profesionales desde el primer día.<br></p>', 1, 'topics', 1, 5, 1698357600, 1732489200, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1698195484, 1698372038, 0, 1, 0, 1698444046, NULL, 1, 1),
(3, 2, 20001, 'Seguridad y Salud en el Trabajo', 'SST', '', '<p dir=\"ltr\" style=\"text-align: left;\">Este curso está diseñado para proporcionar a los estudiantes una comprensión sólida de los principios fundamentales de la seguridad y salud en el trabajo. A lo largo de este programa educativo, los participantes explorarán los conceptos esenciales relacionados con la prevención de accidentes laborales, la identificación de riesgos, el cumplimiento normativo y las mejores prácticas en el lugar de trabajo. A través de estudios de casos, simulaciones y ejercicios prácticos, los estudiantes adquirirán las habilidades necesarias para promover un entorno laboral seguro y saludable. Este curso también aborda la importancia de la higiene ocupacional, la ergonomía y la gestión de emergencias, preparando a los participantes para tomar medidas proactivas en la prevención de lesiones y enfermedades laborales. Al completar el curso, los estudiantes estarán mejor preparados para contribuir a un entorno laboral más seguro y saludable, beneficiando tanto a ellos mismos como a sus colegas.<br></p>', 1, 'topics', 1, 5, 1698271200, 1732489200, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1698267529, 1698372218, 0, 1, 0, 1698374192, NULL, 1, 1);

