INSERT INTO `mdl_question_attempts` (`id`, `questionusageid`, `slot`, `behaviour`, `questionid`, `variant`, `maxmark`, `minfraction`, `maxfraction`, `flagged`, `questionsummary`, `rightanswer`, `responsesummary`, `timemodified`) VALUES
(11, 2, 1, 'deferredfeedback', 1, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué es un EPP (Equipo de Protección Personal) y cuál es su propósito en el entorno laboral?\n\n: Un procedimiento para reportar accidentes.\n\n; Una guía de buenas prácticas en el trabajo.\n\n; Una herramienta eléctrica para trabajadores.\n\n; Un equipo de seguridad para proteger al trabajador.\n\n', 'Un equipo de seguridad para proteger al trabajador.\n\n', NULL, 1698505795),
(12, 2, 2, 'deferredfeedback', 2, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuál es el propósito de un Plan de Emergencia en un lugar de trabajo y cuáles son algunos elementos clave que debe incluir?\n\n: Planificar fiestas y eventos para empleados.\n\n; Determinar los horarios de trabajo.\n\n; Preparar una respuesta efectiva ante situaciones de emergencia.\n\n; Establecer objetivos de producción.\n\n', 'Preparar una respuesta efectiva ante situaciones de emergencia.\n\n', NULL, 1698505795),
(13, 2, 3, 'deferredfeedback', 3, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Por qué es importante la capacitación en seguridad en el trabajo para los empleados y cómo contribuye a la prevención de accidentes?\n\n: Aumenta la productividad.\n\n; Mejora las habilidades de comunicación.\n\n; No es importante.\n\n; Ayuda a los empleados a reconocer riesgos y tomar medidas para prevenir accidentes.\n\n', 'Ayuda a los empleados a reconocer riesgos y tomar medidas para prevenir accidentes.\n\n', NULL, 1698505795),
(14, 2, 4, 'deferredfeedback', 4, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué es un Comité de Seguridad y Salud en el Trabajo y cuál es su función en una empresa?\n\n: Un comité que organiza eventos sociales.\n\n; Un equipo de recursos humanos.\n\n; Un grupo de empleados encargados de las actividades de limpieza.\n\n; Un equipo que promueve y supervisa la seguridad y salud en el trabajo.\n\n', 'Un equipo que promueve y supervisa la seguridad y salud en el trabajo.\n\n', NULL, 1698505795),
(15, 2, 5, 'deferredfeedback', 5, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuáles son algunas prácticas seguras para el manejo de productos químicos en el lugar de trabajo?\n\n: No proporcionar capacitación en la manipulación de productos químicos.\n\n; Usar equipo de protección personal apropiado.\n\n; Mezclar productos químicos sin precaución.\n\n; Almacenar productos químicos en áreas calurosas.\n\n', 'Usar equipo de protección personal apropiado.\n\n', NULL, 1698505795),
(16, 2, 6, 'deferredfeedback', 6, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué significa el término \"ergonomía\" en el contexto de la seguridad en el trabajo y cómo se relaciona con la prevención de lesiones?\n\n: Una técnica de relajación.\n\n; Un término médico sin relevancia en el lugar de trabajo.\n\n; El estudio de los fármacos utilizados en el trabajo.\n\n; El diseño de lugares de trabajo y tareas para adaptarse a las capacidades y limitaciones humanas, lo que ayuda a prevenir lesiones.\n\n', 'El diseño de lugares de trabajo y tareas para adaptarse a las capacidades y limitaciones humanas, lo que ayuda a prevenir lesiones.\n\n', NULL, 1698505795),
(17, 2, 7, 'deferredfeedback', 7, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuáles son los riesgos asociados con la exposición al ruido en el lugar de trabajo y cómo se pueden mitigar?\n\n: Riesgo de pérdida de audición y problemas de salud mental. Se pueden mitigar mediante el uso de protectores auditivos y la reducción del ruido en la fuente.\n\n; Riesgo de quemaduras.\n\n; Ningún riesgo.\n\n; Riesgo de alergias.\n\n', 'Riesgo de pérdida de audición y problemas de salud mental. Se pueden mitigar mediante el uso de protectores auditivos y la reducción del ruido en la fuente.\n\n', NULL, 1698505795),
(18, 2, 8, 'deferredfeedback', 8, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué es un permiso de trabajo y cuándo se debe utilizar en tareas laborales específicas?\n\n: Un permiso para tomar un día libre.\n\n; Un documento que autoriza a realizar trabajos de alto riesgo y se debe utilizar antes de realizar tareas peligrosas.\n\n; Un certificado de reconocimiento de logros laborales.\n\n; Un permiso para salir temprano del trabajo. \n\n', 'Un documento que autoriza a realizar trabajos de alto riesgo y se debe utilizar antes de realizar tareas peligrosas.\n\n', NULL, 1698505795),
(19, 2, 9, 'deferredfeedback', 9, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuáles son las señales de advertencia más comunes utilizadas en un entorno de trabajo y qué significan?\n\n: Señales de tráfico que indican límites de velocidad.\n\n; Señales de publicidad.\n\n; Señales de dirección para el tráfico.\n; Señales que alertan sobre peligros, prohibiciones o precauciones. Por ejemplo, una señal de \"Peligro\" en color amarillo y negro indica un peligro potencial.\n\n', 'Señales que alertan sobre peligros, prohibiciones o precauciones. Por ejemplo, una señal de \"Peligro\" en color amarillo y negro indica un peligro potencial.\n\n', NULL, 1698505795),
(20, 2, 10, 'deferredfeedback', 10, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué papel desempeña la gestión de riesgos en la seguridad y salud en el trabajo, y cómo se pueden identificar y reducir los riesgos en un lugar de trabajo?\n\n: La gestión de riesgos no es relevante en el lugar de trabajo.\n\n; La gestión de riesgos implica identificar, evaluar y reducir los riesgos en el lugar de trabajo para garantizar un entorno más seguro.\n\n; La gestión de riesgos implica tomar riesgos intencionados.\n\n; La gestión de riesgos solo se aplica a empresas grandes.\n\n', 'La gestión de riesgos implica identificar, evaluar y reducir los riesgos en el lugar de trabajo para garantizar un entorno más seguro.\n\n', NULL, 1698505795),
(21, 3, 1, 'deferredfeedback', 21, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué es la inducción en la etapa laboral?\n\n: Un proceso de evaluación de desempeño.\n\n; Una capacitación previa al ingreso de un empleado a la empresa.\n\n; Un proceso de selección de personal.\n\n; Un programa de beneficios para los empleados.\n\n', 'Una capacitación previa al ingreso de un empleado a la empresa.\n\n', NULL, 1698510562),
(22, 3, 2, 'deferredfeedback', 22, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuál es el objetivo principal de la inducción laboral?\n\n: Establecer políticas de la empresa.\n\n; Evaluar el desempeño de los empleados.\n\n; Determinar los aumentos salariales.\n\n; Proporcionar una bienvenida formal a los nuevos empleados.\n\n', 'Proporcionar una bienvenida formal a los nuevos empleados.\n\n', NULL, 1698510562),
(23, 3, 3, 'deferredfeedback', 23, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Durante la inducción laboral, ¿qué tipo de información se proporciona generalmente a los nuevos empleados?\n\n: Detalles de la cuenta bancaria de los empleados.\n\n; Datos personales de los empleados.\n\n; Condiciones de trabajo detalladas.\n\n; Historia de la empresa, cultura organizacional y políticas.\n\n', 'Historia de la empresa, cultura organizacional y políticas.\n\n', NULL, 1698510562),
(24, 3, 4, 'deferredfeedback', 24, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Por qué es importante la cultura organizacional en la etapa de inducción laboral?\n\n: Para promover un ambiente de trabajo positivo y cohesión entre los empleados.\n; Para establecer sanciones para los empleados.\n\n; Para garantizar que los empleados se adhieran a políticas rígidas.\n\n; Para supervisar a los empleados constantemente.\n\n', 'Para promover un ambiente de trabajo positivo y cohesión entre los empleados.\n', NULL, 1698510562),
(25, 3, 5, 'deferredfeedback', 25, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuál es la diferencia entre la orientación y la capacitación en la etapa de inducción laboral?\n\n: La orientación es para empleados temporales, y la capacitación para empleados permanentes.\n\n; No hay diferencia, son términos intercambiables.\n\n; La orientación se refiere a la bienvenida inicial, mientras que la capacitación se enfoca en el desarrollo de habilidades laborales.\n\n; La orientación se realiza antes de la contratación, y la capacitación después de la contratación.\n\n', 'La orientación se refiere a la bienvenida inicial, mientras que la capacitación se enfoca en el desarrollo de habilidades laborales.\n\n', NULL, 1698510562),
(26, 3, 6, 'deferredfeedback', 26, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué debe hacer un nuevo empleado si tiene preguntas o inquietudes durante la etapa de inducción laboral?\n\n: Comunicarse con su supervisor o el departamento de Recursos Humanos.\n\n; Mantener las dudas para sí mismo.\n\n; Dejar el trabajo.\n\n; Hablar con otros empleados.\n\n', 'Comunicarse con su supervisor o el departamento de Recursos Humanos.\n\n', NULL, 1698510562),
(27, 3, 7, 'deferredfeedback', 27, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuál es el propósito de las políticas de seguridad en la inducción laboral?\n\n: Reducir la productividad de los empleados.\n\n; Garantizar que los empleados conozcan y sigan las medidas de seguridad.\n\n; Establecer sanciones por incumplimiento.\n\n; Promover el riesgo en el trabajo.\n\n', 'Garantizar que los empleados conozcan y sigan las medidas de seguridad.\n\n', NULL, 1698510562),
(28, 3, 8, 'deferredfeedback', 28, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuándo suele llevarse a cabo la etapa de inducción laboral?\n\n: Antes de que un empleado comience a trabajar en la empresa.\n\n; Después de que un empleado ha trabajado durante varios años.\n\n; En días festivos.\n\n; Durante la jubilación de un empleado.\n\n', 'Antes de que un empleado comience a trabajar en la empresa.\n\n', NULL, 1698510562),
(29, 3, 9, 'deferredfeedback', 29, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Qué debe hacer un empleado si cree que está siendo acosado en el trabajo?\n\n: Informar al supervisor o al departamento de Recursos Humanos de la empresa.\n\n; Responder con acoso.\n\n; Ignorar la situación.\n\n; Hablar con sus amigos sobre el acoso.\n\n', 'Informar al supervisor o al departamento de Recursos Humanos de la empresa.\n\n', NULL, 1698510562),
(30, 3, 10, 'deferredfeedback', 30, 1, '1.0000000', '0.0000000', '1.0000000', 0, '¿Cuál es la importancia de la retroalimentación en la etapa laboral?\n\n: Para evaluar únicamente el desempeño de los empleados.\n\n; No es importante.\n\n; Para justificar aumentos salariales.\n\n; Para mejorar la cultura organizacional.\n\n', 'Para mejorar la cultura organizacional.\n\n', NULL, 1698510562);

